        <Link to="/courses/table">
            <i className="fas fa-list fa-2x float-right"></i>
        </Link>
        <h1>Course Grid{courses.length}</h1>
        <div className="row">
        {
            courses.map((course,ndx) =>
               <CourseComponent course={course}/>
            )
        }
        </div>
    </div>
}

export default CourseGrid
